        catalog:dataid=\"usp0006dzc\" catalog:eventsource=\"us\" catalog:eventid=\"p0006dzc\"><description><text>119</text><type>Flinn-Engdahl
        region</type></description><description><text>Unconfirmed reports of five
        people killed in Peru; three in Arequipa Province by a landslide collapsing
        their house and two in Cuzco Province; one by falling debris and another by
        a heart attack. Numerous injuries and landslides occurred in southern Peru.
        Damage (VI) at La Paz. In Cochabamba, La Paz and Oruro, a large number of
        windows broke in tall buildings, and some structural damage occurred. Some
        minor structural damage also occurred at Brasilia, Campo Grande, Porto Velho
        and Manaus, Brazil; Arica, Chile and Tacna, Peru. Felt in many parts of South
        America, including most of Argentina, Bolivia and Brazil. Felt lightly in
        Uruguay. Felt (IV) at Arequipa, Moquegua, Puno and Tacna; (III) at Moyobamba,
        Rioja and Tarapoto, Peru. Felt (IV) at Arica, (III) at Iquique, (II) at Copiapo
        and (I) at Santiago, Chile. Felt (IV) at Guayaquil and (III) at Quito, Ecuador.
        Felt on Puerto Rico and in the Dominican Republic. Felt at many locations
        in North America, including Los Angeles, California; Renton, Washington; Omaha,
        Nebraska; Sioux City, Iowa; Minneapolis, Minnesota; La Crosse, Wisconsin;
        Chicago, Illinois; Parkersburg, West Virginia; Norwich, Connecticut; Boston,
        Massachusetts and Toronto, Canada. This is the first earthquake from this
        part of South America believed to have been felt in North America and is also
        believed to be the largest ever recorded in this general area. Three events
        with intervals of about 11.5 seconds between each event. Depth from broadband
        displacement seismograms, based on second event. FAULT PLANE SOLUTION: P-Waves
        NP1:Strike=95 Dip=82 Slip=-98 NP2:Strike=320 Dip=11 Slip=-45 Principal Axes:
        (T) Plg=37 Azm=192 (P) Plg=52 Azm=356 Comment: The focal mechanism is poorly
        controlled and corresponds to normal faulting with a small left-lateral strike-slip
        component. The preferred fault plane is NP2. RADIATED ENERGY No. of sta: 25
        Focal mech. F Energy 3.2+0.6*10**16 Nm MOMENT TENSOR SOLUTION Dep 631 No.
