eferredWeight":1,"contents":{"contents.xml":{"contentType":"application/xml","lastModified":1435684697000,"length":195,"url":"https://earthquake.usgs.gov/archive/product/focal-mechanism/choy19941004132255/us/1435683541952/contents.xml"},"quakeml.xml":{"contentType":"application/xml","lastModified":1435683541000,"length":2777,"url":"https://earthquake.usgs.gov/archive/product/focal-mechanism/choy19941004132255/us/1435683541952/quakeml.xml"}}}],"impact-text":[{"indexid":"39298881","indexTime":1417546357498,"id":"urn:usgs-product:us:impact-text:usp0006kdp:1415321786359","type":"impact-text","code":"usp0006kdp","source":"us","updateTime":1415321786359,"status":"UPDATE","properties":{"eventParametersPublicID":"quakeml:US.anss.org/eventParameters/pde19941004132255840_14/1415321786359","eventsource":"us","eventsourcecode":"p0006kdp"},"preferredWeight":6,"contents":{"":{"contentType":"text/plain","lastModified":1415321786000,"length":2270,"bytes":"At
        least 10 people killed or missing, many injured and damage on Iturup. Considerable
        damage (IX) on Shikotan from the earthquake and tsunami. Damage also occurred
        on Kunashir. Felt (IV) at Kurilsk; (III) at Severo-Kurilsk and on Matua; (II)
        on Simushir. One person died from a heart attack, at least 200 people were
        injured and extensive damage and landslides occurred along the eastern coast
        of Hokkaido. Felt strongly in northern Honshu and as far south as the Tokyo
        area. Tsunami wave heights from selected tide stations (peak-to-trough) were
        as follows: 346 cm. at Hanasaki, 164 cm. at Kushiro, 26 cm. at Abashiri, Hokkaido;
        144 cm. at Miyako, 130 cm. at Hachinohe, 92 cm. at Ofunato, 62 cm. at Onahama,
        46 cm. at Omae-zaki, 42 cm. at Choshi, Honshu; 162 cm. on Chichi-shima; 300
        cm. at Yuzhno-Kurilsk, Kunashir Island, 15 cm. on Shemya, 16 cm. at Pago Pago,
        American Samoa, 17 cm. on Wake Island, 50 cm. on Midway Island and 48 cm.
        at Hilo, Hawaii. Complex event observed on broadband displacement seismograms.
        FAULT PLANE SOLUTION: P-Waves NP1:Strike=55 Dip=78 Slip=145 NP2:Strike=153
