        publicID=\"quakeml:US.anss.org/event/pde19941004132255840_14\" catalog:datasource=\"us\"
        catalog:dataid=\"usp0006kdp\" catalog:eventsource=\"us\" catalog:eventid=\"p0006kdp\"><description><text>221</text><type>Flinn-Engdahl
        region</type></description><description><text>At least 10 people killed or
        missing, many injured and damage on Iturup. Considerable damage (IX) on Shikotan
        from the earthquake and tsunami. Damage also occurred on Kunashir. Felt (IV)
        at Kurilsk; (III) at Severo-Kurilsk and on Matua; (II) on Simushir. One person
        died from a heart attack, at least 200 people were injured and extensive damage
        and landslides occurred along the eastern coast of Hokkaido. Felt strongly
        in northern Honshu and as far south as the Tokyo area. Tsunami wave heights
        from selected tide stations (peak-to-trough) were as follows: 346 cm. at Hanasaki,
        164 cm. at Kushiro, 26 cm. at Abashiri, Hokkaido; 144 cm. at Miyako, 130 cm.
        at Hachinohe, 92 cm. at Ofunato, 62 cm. at Onahama, 46 cm. at Omae-zaki, 42
        cm. at Choshi, Honshu; 162 cm. on Chichi-shima; 300 cm. at Yuzhno-Kurilsk,
        Kunashir Island, 15 cm. on Shemya, 16 cm. at Pago Pago, American Samoa, 17
        cm. on Wake Island, 50 cm. on Midway Island and 48 cm. at Hilo, Hawaii. Complex
        event observed on broadband displacement seismograms. FAULT PLANE SOLUTION:
        P-Waves NP1:Strike=55 Dip=78 Slip=145 NP2:Strike=153 Dip=56 Slip=15 Principal
        Axes: (T) Plg=33 Azm=9 (P) Plg=14 Azm=108 Comment: The focal mechanism is
        moderately well controlled and corresponds to strike-slip faulting with a
        large reverse component. The preferred fault plane is not determined. Complex
        rupture; focal mechanism based on second subevent. RADIATED ENERGY No. of
        sta: 33 Focal mech. F Energy 1.1+0.1*10**17 Nm MOMENT TENSOR SOLUTION Dep
        61 No. of sta: 41 Moment Tensor; Scale 10**21 Nm Mrr=0.67 Mtt=0.57 Mff=-1.24
        Mrt=1.18 Mrf=0.76 Mtf=-1.01 Principal axes: (T) Val=1.81 Plg=44 Azm=5 (N)
